void shake_image(int img[], int screenx, int screeny){
	flush_buffer();
	for(int i=0;i<2;i++){
        plot_image(img,70,70,screenx,screeny);

        wait_for_sync(); // swap front and back buffers on VGA vertical sync
        pixel_buffer_start = *(pixel_ctrl_ptr + 1); // new back buffer

        clear_image(img,70,70,screenx,screeny);
        plot_image(img,70,70,screenx-4,screeny);

        wait_for_sync(); // swap front and back buffers on VGA vertical sync
        pixel_buffer_start = *(pixel_ctrl_ptr + 1); // new back buffer
    }
    //clears before exit
	clear_screen();
	wait_for_sync(); // swap front and back buffers on VGA vertical sync
	pixel_buffer_start = *(pixel_ctrl_ptr + 1); // new back buffer
}

