void clear_image(int img[], int height, int width, int screenx, int screeny){
	int i = 0, j = 0;	
	
	for (int k = 0 ; k < (height * width * 2)-1; k+= 2) {
		
		plot_pixel(i+screenx, j+screeny, 0x0000);

		i+=1;		  
		if (i == width) {
			i = 0;
			j+=1;
		}
	}
}

void plot_image(int img[], int height, int width, int screenx, int screeny){
    int i = 0, j = 0;
    
    for (int k = 0 ; k < (height * width * 2)-1; k+= 2) {
        
        int red = ((img[k + 1] & 0xF8) >> 3) << 11;
        int green  = (((img[k] & 0xE0) >> 5)) | ((img[k+1] & 0x7) << 3) ;
        int blue = (img[k] & 0x1f);

        short int p = red | ( (green << 5) | blue);

        plot_pixel(i+screenx, j+screeny, p);

        i+=1;
        if (i == width) {
            i = 0;
            j+=1;
        }
    }
}



//modified from DE1-SOC manual
//Subroutine to send a string of text to the video monitor
void video_text(int x, int y, char * text_ptr) {
    int offset;
    volatile char * character_buffer =(char *)FPGA_CHAR_BASE; // video character buffer
    /* assume that the text string fits on one line */
    offset = (y << 7) + x;
    while (*(text_ptr)) {
        *(character_buffer + offset) =
        *(text_ptr); // write to the character buffer
        ++text_ptr;
        ++offset;
    }
}

//num=the number of characters you want to clear
void clear_video_text(int x, int y, int num) {
    int offset;
    volatile char * character_buffer =(char *)FPGA_CHAR_BASE; // video character buffer

    offset = (y << 7) + x;
    int i=0;
    while (i<num) {
        *(character_buffer + offset) =0; // write to the character buffer
        ++i;
        ++offset;
    }
    *(character_buffer + offset)=0;
}







void wait_for_sync(){
    volatile int * pixel_ctrl_ptr = (int *)0xFF203020;
    int status;
    //write 1, cause swap
    *(pixel_ctrl_ptr)=1;
    
    status=*(pixel_ctrl_ptr+3);
    //poll, see if swap is done
    while((status & 0x1)==1){
        status=*(pixel_ctrl_ptr+3);
    }
    
}





